import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTimes } from '@fortawesome/free-solid-svg-icons'

function Menu() {
    return (
        <div className="menu">
         <FontAwesomeIcon icon={faTimes} />
        </div>
    )
}

export default Menu
